        List<SettingsNode> children = rootNode.getChildNodes();
        assertEquals(0, children.size());


        rootNode.setValueOfChild(SAMPLE_NAME_1, "true");
        rootNode.setValueOfChild(SAMPLE_NAME_2, "false");
